import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import {Box, Typography, useTheme, useMediaQuery, TextField, Button, Alert, Collapse} from '@mui/material';

const Register = () => {
  const theme = useTheme();

  //media
  const isNotMobile = useMediaQuery("(min-width: 1000px)");
  // states
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  return (
    <Box width={isNotMobile ? "40%" : "80%"} p={"2rem"} m={"2rem auto"} borderRadius={5} sx={{ boxShadow: 5 }} backgroundColor={theme.palette.background.default}>
      <form>
        <Typography variant='h3'> Sign Up</Typography>
        <TextField
          label="Username"
          required
          margin="normal"
          fullWidth
          value={username}
          onChange={(e) => {
            setUsername(e.target.value);
          }}
        />

        <TextField
          label="Email"
          type='email'
          required
          margin="normal"
          fullWidth
          value={username}
          onChange={(e) => {
            setEmail(e.target.value);
          }}
        />

        <TextField
          label="Password"
          type='password'
          required
          margin="normal"
          fullWidth
          value={username}
          onChange={(e) => {
            setUsername(e.target.value);
          }}
        />
        <Button type='submit' fullWidth variant='contained' size='large' sx={{backgroundColor: theme.palette.background.alt, color:'white', mt:2, '&:hover':{backgroundColor:theme.palette.background.basic} }}> 
        Register
        </Button>


        
        <Typography mt={2}>
          Already have an account ? <Link to="/login" component={CustomLink}>Login</Link>
        </Typography>
      </form>
    </Box>
    
  );
};
const CustomLink = (props) => {
  return (
    <Link
      {...props}
      style={{ color: 'inherit', textDecoration: 'none' }}
      // override link styling
    />
  );
};
export default Register;
